// SPDX-License-Identifier: MIT
pragma solidity 0.8.12;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract MyERC20Token is Ownable {

  string public name = "MyERC20 token";
  string public symbol = "MYERC";
  uint256 public decimals = 18;
  uint256 public totalSupply;

  mapping(address => uint256) public balanceOf;
  mapping(address => mapping(address => uint256)) public allowance;

  event Approval(address from, address spender, uint256 value);
  event Transfer(address from, address to, uint256 amount);

  modifier notOwner() {
        require(owner() != _msgSender(), "Caller is the owner");
        _;
  }

  function transfer(address to, uint256 value) public returns (bool) {
    _transfer(msg.sender, to, value);
    return true;
  }

  function _transfer(address from, address to, uint256 value) private {
    require(balanceOf[from] >= value, "Not enougth token");

    balanceOf[from] -= value;
    balanceOf[to] += value;

    emit Transfer(from, to, value);
  }


  function approve(address spender, uint256 value) public returns (bool) {

    _approve(msg.sender, spender,value);

    return true;
  }


  function _approve(address from, address spender, uint256 value) private {
    require(spender != address(0), "Not approve owner smart contract");

    allowance[from][spender] = value;

    emit Approval(msg.sender, spender, value);
  }

  function transferFrom(address from, address to, uint256 value) public returns (bool) {
      require(allowance[from][msg.sender] >= value, "Not allowed");

      _transfer(from, to, value);

      allowance[from][msg.sender] -= value;

      return true;
  }

  function stack(address to, uint256 amount) internal {
        totalSupply += amount;
        balanceOf[to] += amount;
        emit Transfer(address(0), to, amount);
    }


  function _sendReward(address account, uint256 amount) private notOwner {
    require(amount > 0, "Insifucient amount");
    totalSupply += amount;
    balanceOf[account] += amount;

    emit Transfer(address(0), account, amount);
  }

  function sendReward(address to, uint256 amount) public notOwner returns (bool) {
    _sendReward(to, amount);
    return true;
  }
}
